import React from 'react'

import TodoItem from './TodoItem'

export default class TodoList extends React.Component {
  render() {
    const Todos = this.props.todos.map((todo, i)=>{

      return(
        <TodoItem
          key={i}
          title={todo.title}
          desc={todo.desc}
          isDone={todo.isDone}
        ></TodoItem>
      )
    })
  }
}
